import axios from "axios"
import {useEffect} from "react"
import { useNavigate } from "react-router-dom";

var logged = false;
var navigate = useNavigate;

useEffect(()=>{

    const token =  localStorage.getItem("token");
    if(token){
        axios.post("http://localhost:5000/",{headers : {"Authorization" : `Bearer ${token}`}}).then((res)=>{
            if(res.data.msg!="hola"){
                navigate("/login");
            }
        })
    }else{
        navigate("/login");
    }

    
},[]);

function Home(){
    
    return(
        <h1>Hello world</h1>
    )
}

export default Home;
